import React from 'react';
import { Rialto as RialtoInterface } from '../scripts/types';

interface RialtoProps extends RialtoInterface {
    onAdd: Function,
};

const RialtoItem: React.FC<RialtoProps> = ({ name, about, price, onAdd, }) => {
    const handleAdd = () => {
        onAdd();
    };

    return (
        <div className="p-4 w-3/12">
            <div className="bg-gray-200 rounded-xl p-4 h-full">
                <h2 className="text-xl font-semibold mb-2">
                    { name }
                </h2>
                <p className="text-gray-600 mb-4">
                    { about }
                </p>
                <div className="flex justify-end items-center">
                    <button
                        onClick={handleAdd}
                        className="px-4 py-2 bg-green-500 text-white rounded hover:bg-green-600 transition duration-300"
                    >
                        { price } $
                    </button>
                </div>
            </div>
        </div>
    );
};

export default RialtoItem;
